import React, {Component} from 'react';
import {Link} from 'react-router-dom'
import axios from "axios";


class TableRow extends Component {
    constructor(props) {
        super(props);
        this.deletesss = this.deletesss.bind(this);
    }
    deletesss(){
      axios.get('http://localhost:4000/trainFoodAdmin/admindeleteFood/'+this.props.obj._id)
          .then(this.setState({redirect: true}))
          .catch(err => console.log(err))
      //this.props.history.push('/index');
      alert("Your Food Successfully Deleted....")
      window.location.replace('/adminviewfood/'+this.props.obj.station);
  }
    render() {
        return (
            <div className='pro-details'>
                <table className="table table-striped">
                   <tr>
                      <td style={{fontWeight:'bold'}}>Project Tittle</td>
                      <td>{this.props.obj.tittle}</td>
                   </tr>
                   <tr>
                      <td style={{fontWeight:'bold'}}>Project Owner</td>
                      <td>{this.props.obj.owner}</td>
                   </tr>
                   <tr>
                      <td style={{fontWeight:'bold'}}>Amount</td>
                      <td>Rs. {this.props.obj.amount}</td>
                   </tr>
                   <tr>
                      <td style={{fontWeight:'bold'}}>Description</td>
                      <td>{this.props.obj.description}</td>
                   </tr>
                   <tr>
                      <td style={{fontWeight:'bold'}}>Type</td>
                      <td>{this.props.obj.type}</td>
                   </tr>
                   <tr>
                      <td style={{fontWeight:'bold'}}>Duration</td>
                      <td>{this.props.obj.duration}</td>
                   </tr>
                   <tr>
                      <td style={{fontWeight:'bold'}}>Status</td>
                      <td>{this.props.obj.status}</td>
                   </tr>
                   <tr>
                      <td> 
                         <Link to={"/editproject/"+this.props.obj._id} className="btn btn-success">Edit</Link> &nbsp;&nbsp;
                         <button onClick={this.deletesss} className="btn btn-danger">Delete</button> &nbsp;&nbsp;
                         <button onClick={this.deletesss} className="btn btn-info">Accept</button> &nbsp;&nbsp;
                         <button onClick={this.deletesss} className="btn btn-warning">Reject</button> &nbsp;&nbsp;
                         <Link to={"/adminViewProject"} className="btn btn-dark">Go Back</Link> &nbsp;&nbsp;
                      </td>
                   </tr>
                </table>
            </div>
        );
    }
}

export default TableRow;
